using Application.Features.Rents.UpdateReturn;
using Domain.DeliveryPeople;
using Domain.Motorcycles;
using Domain.Rents;
using FluentAssertions;
using FluentValidation;
using IntegrationTest.Fixtures;
using Microsoft.Extensions.Logging;
using Moq;
using Shared.Results;

namespace IntegrationTest.Rents.UpdateReturn;

public class UpdateRentReturnCommandHandlerTest(ApplicationDbContextFixture fixture) : IClassFixture<ApplicationDbContextFixture>
{
    [Fact]
    public async Task Handle_ShouldUpdateRentReturn()
    {
        // Arrange
        var dbContext = fixture.BuildDbContext(Guid.NewGuid().ToString());

        dbContext
            .Motorcycles
            .Add(
                new Motorcycle()
                    .SetIdentifier("Yamaha-MT-07")
                    .SetModel("MT-07")
                    .SetYear(2021)
                    .SetPlate("ABC-1234")
            );

        dbContext
            .DeliveryPeople
            .Add(
                new DeliveryPerson()
                    .SetIdentifier("Person-1")
                    .SetName("Peter Parker")
                    .SetDateOfBirth(new DateTime(2000, 04, 01))
                    .SetEin("94237956000155")
                    .SetDriversLicenseImagem("data:image/png;base64,")
                    .SetDriversLicenseNumber(Guid.NewGuid().ToString())
                    .SetDriversLicenseType(DriversLicenseType.A)
            );

        var rent = new Rent()
                   .SetPlan(7)
                   .SetMotorcycleId("Yamaha-MT-07")
                   .SetDeliveryPersonId("Person-1")
                   .SetStartDate(DateTime.Now.AddDays(1))
                   .SetEndDate(DateTime.Now.AddDays(8))
                   .SetForecastDateEnd(DateTime.Now.AddDays(8));
        dbContext
            .Rents
            .Add(rent);

        await dbContext.SaveChangesAsync();

        await dbContext.SaveChangesAsync();

        var validatorMock = new Mock<IValidator<UpdateRentReturnCommand>>();
        validatorMock.Setup(v => v.ValidateAsync(It.IsAny<UpdateRentReturnCommand>(), It.IsAny<CancellationToken>()))
                     .ReturnsAsync(new FluentValidation.Results.ValidationResult());
        
        var mockLogger = new Mock<ILogger<UpdateRentReturnCommandHandler>>();
        var handler = new UpdateRentReturnCommandHandler(dbContext, validatorMock.Object, mockLogger.Object);
        var command = new UpdateRentReturnCommand
        {
            Id = rent.Id.ToString(),
            EndDate = DateTime.Now.AddDays(8)
        };

        // Act
        var result = await handler.Handle(command, CancellationToken.None);

        // Assert
        result.Should().BeOfType<ServiceResult>();
        result.IsSuccess.Should().BeTrue();
        result.Notifications.Should().NotBeEmpty();
        result.Notifications?.Count().Should().Be(1);
        result.Notifications?.FirstOrDefault()?.Message.Should().Be("Data de devolução informada com sucesso");
    }

    [Fact]
    public async Task Handle_ShouldTryUpdateRentForInvalidRent()
    {
        // Arrange
        var dbContext = fixture.BuildDbContext(Guid.NewGuid().ToString());

        dbContext
            .Motorcycles
            .Add(
                new Motorcycle()
                    .SetIdentifier("Yamaha-MT-07")
                    .SetModel("MT-07")
                    .SetYear(2021)
                    .SetPlate("ABC-1234")
            );

        dbContext
            .DeliveryPeople
            .Add(
                new DeliveryPerson()
                    .SetIdentifier("Person-1")
                    .SetName("Peter Parker")
                    .SetDateOfBirth(new DateTime(2000, 04, 01))
                    .SetEin("94237956000155")
                    .SetDriversLicenseImagem("data:image/png;base64,")
                    .SetDriversLicenseNumber(Guid.NewGuid().ToString())
                    .SetDriversLicenseType(DriversLicenseType.A)
            );

        var rent = new Rent()
                   .SetPlan(7)
                   .SetMotorcycleId("Yamaha-MT-07")
                   .SetDeliveryPersonId("Person-1")
                   .SetStartDate(DateTime.Now.AddDays(1))
                   .SetEndDate(DateTime.Now.AddDays(8))
                   .SetForecastDateEnd(DateTime.Now.AddDays(8));
        dbContext
            .Rents
            .Add(rent);

        await dbContext.SaveChangesAsync();

        await dbContext.SaveChangesAsync();

        var validatorMock = new Mock<IValidator<UpdateRentReturnCommand>>();
        validatorMock.Setup(v => v.ValidateAsync(It.IsAny<UpdateRentReturnCommand>(), It.IsAny<CancellationToken>()))
                     .ReturnsAsync(new FluentValidation.Results.ValidationResult());
        
        var mockLogger = new Mock<ILogger<UpdateRentReturnCommandHandler>>();
        var handler = new UpdateRentReturnCommandHandler(dbContext, validatorMock.Object, mockLogger.Object);
        var command = new UpdateRentReturnCommand
        {
            Id = Guid.NewGuid().ToString(),
            EndDate = DateTime.Now.AddDays(8)
        };

        // Act
        var result = await handler.Handle(command, CancellationToken.None);

        // Assert
        result.Should().BeOfType<ServiceResult>();
        result.IsFailure.Should().BeTrue();
        result.Notifications.Should().NotBeEmpty();
        result.Notifications?.Count().Should().Be(1);
        result.Notifications?.FirstOrDefault()?.Message.Should().Be("Dados inválidos");
    }
}